  def base_product
    {:breadcrumb=>"Зоотовары *** Аквариумистика *** Живые обитатели *** Рыбки", :diff=>"[{\"Description\":\"Неон голубой (Paracheirodon innesi) Семейство: харациновых. Размер: самка вырастает до 4 сантиметров, самец, как правило, на 0,5-1 сантиметр меньше. Продолжительность жизни: 3-5 лет в аквариуме. Содержание: могут содержаться в любом, даже самом маленьком аквариуме. Рекомендуется заводить стайку не менее пяти-шести рыбок. Оптимальные параметры воды: dH 5-7° рН 6.5-7 23°С-24°С. Освещение: слабое. Допускается яркое освещение с наличием густой тени. Рацион: мотыль, циклопы, энхитрея, мелкая дафния, трубочник, коретра, различные сублимированные или замороженные корма, хлопья и гранулы.\"}]", :image=>["/upload/iblock/dec/dec2ad79f1b916c2b20ed51a5e3df45b.jpg", "/upload/iblock/308/3087cc2552b392e2144ecc13c2a3f245.jpg", "/upload/iblock/efd/efd3dc018a6a68308365a5020893646c.jpg"], :name=>"Неон (голубой)"}
